function Footer(){
    return(
        <footer>
            <a className="btn btn-primary btn-floating m-1"
                style="background-color: #3b5998;"
                href="#!"
                role="button"
                ><i class="fab fa-facebook-f"></i
            ></a>
        </footer>
    )
}

export default Footer
